import React, { useState } from 'react'
import './domain.css'
import { useNavigate } from 'react-router-dom'

export default function Finance() {

 
  const navigate = useNavigate();

  const [answers, setAnswers] = useState({
    qn1: [],
    qn2: [],
    qn3: [],
    r1: '',
    r2: '',
    r3: '',
    r4: '',
    r5: '',
    r6: '',
    r7: '',
    r8: '',
  });

  const handleInputChange = (event) => {
    const { name, value, type } = event.target;
    if (type === 'checkbox') {
      // Handle checkbox input
      const isChecked = event.target.checked;
      setAnswers((prevAnswers) => ({
        ...prevAnswers,
        [name]: isChecked
          ? [...prevAnswers[name], value]
          : prevAnswers[name].filter((item) => item !== value),
      }));
    } else {
      // Handle other input types
      setAnswers({ ...answers, [name]: value });
    }
  };

  

  const redirectToForm = () => {
    // Save the answers in localStorage
    localStorage.setItem('finAnswers', JSON.stringify(answers));
  
    // Redirect to the answers page
    navigate('/answers');
  };
  
  return (
    <div className="fm">
        <form>
            <center><h1 className="title">Financial Services</h1></center>
            <div className="qns">
              <center><h1>Fill the following</h1></center>
                <label><b>1. What area of financial services are you interested in?</b></label><br/>
                <input type="checkbox" name="qn1" value="qn1" onChange={handleInputChange} /> Banking <br />
                <input type="checkbox" name="qn1" value="qn1" onChange={handleInputChange}/> Investment and wealth management <br />
                <input type="checkbox" name="qn1" value="qn1" onChange={handleInputChange}/> Insurance <br />
                <input type="checkbox" name="qn1" value="qn1" onChange={handleInputChange}/> Not sure <br />
                <label><b>2. What tasks or activities do you want to accomplish using cloud services?</b></label><br/>
                <input type="checkbox" name="qn2" value="qn2" onChange={handleInputChange}/> Customer Identity and Access Management <br />
                <input type="checkbox" name="qn2" value="qn2" onChange={handleInputChange}/> Fraud Detection and Prevention <br />
                <input type="checkbox" name="qn2" value="qn2" onChange={handleInputChange}/> Financial Mobile Apps     <br />
                <input type="checkbox" name="qn2" value="qn2" onChange={handleInputChange}/> Hosting Website <br />
                <label><b>3. Would you like to implement a financial chatbot for customer inquiries and support?</b></label><br/>
                <input type="radio" name="r1" value="r1" onChange={handleInputChange}/>Yes  <input type="radio" name="r1" value="r1" onChange={handleInputChange}/>No <br />
                <label><b>4. Are you looking for a system to manage and track insurance claims and customer policy details?</b></label><br/>
                <input type="radio" name="r2" value="r2" onChange={handleInputChange}/>Yes  <input type="radio" name="r2" value="r2" onChange={handleInputChange}/>No <br />
                <label><b>5. What is the expected geographical distribution of your users?</b></label><br/>
                <input type="checkbox" name="qn3" value="qn3" onChange={handleInputChange}/> Local / Regional <br />
                <input type="checkbox" name="qn3" value="qn3" onChange={handleInputChange}/> National <br />
                <input type="checkbox" name="qn3" value="qn3" onChange={handleInputChange}/> Global <br />
                <label><b>6. Do you have any existing software?</b></label><br/>
                <input type="radio" name="r3" value="r3" onChange={handleInputChange}/>Yes  <input type="radio" name="r3" value="r3" onChange={handleInputChange}/>No <br />
                <label><b>7. What is your expected user load? </b></label><br/>
                <input type="radio" name="r4" value="r4" onChange={handleInputChange}/> A few hundred users (&gt;100) <br/> <input type="radio" name="r4" value="r4" onChange={handleInputChange}/>Thousands of users (&gt; 1000) <br />
